import React from 'react'
import FileInput from '../../components/ui/FileInput'
import NumberInput from '../../components/ui/NumberInput'
import URLInput from '../../components/ui/URLInput'
import useFormContext from '../../Hooks/useFormContext'

const ExperienceInfo = () => {
  const { userData, handleChange, stepTitle, step } = useFormContext()

  return (
    <div>
      <h1>{stepTitle[step]}</h1>
      <NumberInput
        labelText="Hackathons Attended"
        fieldName="hackatonsAttended"
        min="0"
        fieldValue={userData.hackatonsAttended}
        handleChange={handleChange}
      />
      <URLInput
        labelText="Github Link"
        fieldName="github"
        fieldValue={userData.github}
        handleChange={handleChange}
      />
      <URLInput
        labelText="LinkedIn Link"
        fieldName="linkedin"
        fieldValue={userData.linkedin}
        handleChange={handleChange}
      />
      <FileInput
        labelText="Upload resume"
        fieldName="resume"
        fieldValue={userData.resume}
        handleChange={handleChange}
      />
    </div>
  )
}

export default ExperienceInfo
